import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

let IMG = "https://picsum.photos/250/300"
let IMG2 = "https://picsum.photos/260/300"

ReactDOM.render(
    <>
        <h1 className="Heading" contentEditable="true">Himanshu</h1>
        <img  src={IMG} alt='Img'/>
        <img src={IMG2} alt='Img2'/>
    </>,
    document.getElementById('root')
)
